import React from 'react'
import {useNavigate} from 'react-router-dom';

function Login() {
    const navigation =useNavigate();
  return (
    <div>
        <p>Login</p>
        <button onClick={() => navigation('/adminhome')}>Submit</button>
    </div>
  )
}

export default Login
